import React from 'react'
import styled from 'styled-components'

const IntroWrapper = styled.div`

    border: 2px dashed #ededed;
    padding: 25px;

`;

const Intro = ({userMeta}) => {

    return (
        <IntroWrapper>
            <h2>Welcome {userMeta.displayName ? userMeta.displayName: null}</h2>
            <p>Here you can change your profile information or se your data</p>
        </IntroWrapper>
    )
}

export default Intro
